import React, {useEffect} from 'react'
import axios from "axios";

export default function GetVehicles() {
  const [veiculos, setVeiculos] = useState([]);
    
  useEffect(() => {
    axios
      .get("http://localhost:4000/veiculos")
      .then((res) => {
        setVeiculos(res.data);
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);
  return (
    <div>index</div>
  )
}
